import React, {Component} from 'react'
import {data} from '..Data/users.js'
import {Userlist} from './User/Users'



class App extends Component   {
  state = {
    users: data,
  };
  render () {
    const {users} = this.state
  return (
   <div>
    < Userlist users={users}/>
   </div>
  );
};
}

export default App;
